import React from 'react';
import {
  Container,
  Grid,
  IconButton,
  List,
  ListItem,
  ListItemText,
  Typography
} from '@material-ui/core';
import {
  Language as WebIcon,
  Settings as SettingsIcon
} from '@material-ui/icons';

import { webThreatData } from '../data';

export default function WebControlContainer(props){
  console.log(props);
  return(
    <Container>
      <Grid container>
        <WebIcon />
        <Typography>Web Protection</Typography>
      </Grid>
      <Grid container>
        <Typography>Protection level: High</Typography>
        <IconButton>
          <SettingsIcon />
        </IconButton>
      </Grid>
      <Typography>Active Categories</Typography>
      <List>
        {webThreatData.map((threat) => {
            console.log(threat);
            if(threat.familyMember === props.familyMember.first_name){
              return(
                <ListItem>
                  <ListItemText>{threat.category}</ListItemText>
                </ListItem>
            );
          };
        })}
      </List>
    </Container>
  );
};
